**Describe the bug**
I'm trying to get `onnxruntime-react-native` working in a managed Expo app.  Whenever I try to create a new `InferenceSession`, I receive the error message:
```bash
Error: "Can't load a model: null is not an object (evaluating '(0,u.default)(this,p)[p].loadModel')"
...
```

Here is a minimal example on `snack.expo.dev` to reproduce the issue:
https://snack.expo.dev/@fkodom/expo-onnxruntime

When I run the example locally on my Macbook, I get a slightly different (but seemingly closely related) error:
```bash
Can't load a model: null is not an object (evaluating '(0, _classPrivateFieldLooseBase2.default)(this, _inferenceSession)[_inferenceSession].loadModel')
at node_modules/onnxruntime-react-native/lib/backend.ts:61:12 in OnnxruntimeSessionHandler#loadModel
at node_modules/onnxruntime-react-native/lib/backend.ts:49:2 in OnnxruntimeSessionHandler#loadModel
at node_modules/onnxruntime-react-native/lib/backend.ts:151:10 in OnnxruntimeBackend#createSessionHandler
at node_modules/onnxruntime-react-native/lib/backend.ts:145:2 in OnnxruntimeBackend#createSessionHandler
at node_modules/onnxruntime-common/dist/ort-common.node.js:6:6604 in c.create
```

I have confirmed that:
* `onnxruntime-react-native` is installed, and I can create `Tensor` objects.
* The model asset `mnist.ort` downloads successfully, and saves to a local URI.  
    * The model was pulled from [this example in the `microsoft/onnxruntime` docs](https://github.com/microsoft/onnxruntime/tree/master/js/react_native/e2e)

**Urgency**
None

**System information**
- OS -- Linux & Mac
- Expo -- `44.0.0`
- `onnxruntime-react-native` -- `1.11.0`
- Platforms:
    - iOS (device & simulator)
    - Android (simulator)

**To Reproduce**
Please see the example linked above (copied again here):
https://snack.expo.dev/@fkodom/expo-onnxruntime

Link to the ORT model that I'm using to initialize the `InferenceSession`:
https://github.com/microsoft/onnxruntime/blob/master/js/react_native/e2e/src/mnist.ort

Minimal reproducing code from the linked example:
```js
import React, { useState, useEffect } from 'react';

import { Asset } from 'expo-asset';
import { InferenceSession, Tensor } from "onnxruntime-react-native";

export default function App() {
  const [onnxSession, setOnnxSession] = useState(null);

  const initInferenceSession = async () => {
      const asset = Asset.fromURI("https://github.com/microsoft/onnxruntime/blob/master/js/react_native/e2e/src/mnist.ort");
      if (!asset.localUri) {
        console.log("Downloading asset.")
        await asset.downloadAsync();
        console.log("Local URI: " + asset.localUri);
      }

      try {
        const session = await InferenceSession.create(asset.localUri, { executionProviders: ['cpu'] });
        console.log("Session (initInferenceSession): " + session);
        setOnnxSession(session);
      } catch (e) {
        console.log(e);
      }
  }

  useEffect(() => { 
    initInferenceSession(); 
  }, []);

  return null;
}
```


**Expected behavior**
Able to create a new `InferenceSession` from an ORT model.

 Ort::AllocatorWithDefaultOptions allocator_;
 allocator_ = Ort::AllocatorWithDefaultOptions(); 
float *columns = (float *)allocator_.Alloc(sizeof(float) * column_len);


This is the cpu memory request. My question is how to allocate memory on gpu accordingly? Is there a corresponding onnxruntime-API?

**Describe the bug**
I just want to run onnx file with C++, and I can't #include <onnxruntime_cxx_api.h> successfully.
The ERROR is:
Undefined symbols for architecture arm64:

  "_OrtGetApiBase", referenced from:
      ___cxx_global_var_init in main.cpp.o
ld: symbol(s) not found for architecture arm64
clang: error: linker command failed with exit code 1 (use -v to see invocation)

**Urgency**
If it's possible, it;s better to solve it quickly, 'cause I have a ddl next week. PLEASE!

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Mac OS Montery with Apple M1 Pro.
- ONNX Runtime installed from (source or binary): onnxruntime-osx-arm64-1.11.1.tgz and onnxruntime-osx-arm64-1.10.0.tgz
- ONNX Runtime version: onnxruntime-osx-arm64-1.11.1  and onnxruntime-osx-arm64-1.10.0 (I tried both of them.)
- Python version: None
- Visual Studio version (if applicable): I use CLion.
- GCC/Compiler version (if compiling from source): None.
- CUDA/cuDNN version: None.
- GPU model and memory: None.

**To Reproduce**
Just have a main.cpp with #include and #include<onnxruntime_cxx_api.h> with the main printing "hello word".
the makefile or cmakelists include_directories to the onnxrutime installation path as well as folders within such as include and lib.

**Expected behavior**
Only want to use onnxruntime successfully to deploy the yolov5.onnx.

